import * as React from "react";
type Props = {};

const PerkLevel: React.FunctionComponent<Props> = (
  onClick: Function,
  image: any
) => (
  <li onClick={onClick} className="perk-level">
    <img src={image} alt="perk-image" className="perk-image" />
  </li>
);

export default PerkLevel;
